import "./ContentList.css";

function ContentList({ contents, setContents }) {
  return (
    <div className="ContentList">
      <header>
        <div></div>
        <h2>목록</h2>
        <button className="contentList__btn">글쓰기</button>
      </header>
      <div className="content__item">
        <li className="contents__list">
          <div className="username">이름</div>
          <div className="title">제목</div>
          <div className="createAt">날짜</div>
        </li>
        {contents.map((el, idx) => (
          <li className="contents__list" key={idx}>
            <div className="contents__username">{el.username}</div>
            <div className="contents__title">{el.title}</div>
            <div className="contents__createAt">{el.createdAt}</div>
          </li>
        ))}
      </div>
    </div>
  );
}

export default ContentList;
